import React from "react";
import TodoItem from "./TodoItem";

const TodoList = ({ todo, handleDelete, handleChecked }) => {
  return (
    <div>
      {todo.map((item) => (
        <TodoItem
          data-testid="test"
          todo={item}
          key={item.id}
          handleDelete={handleDelete}
          handleChecked={handleChecked}
        />
      ))}
    </div>
  );
};

export default TodoList;
